/** 
 * The Presence associated with the provided JDA instance
 */
public class PresenceImpl implements Presence {
  private final JDAImpl api;
  private boolean idle=false;
  private Game game=null;
  private OnlineStatus status=OnlineStatus.ONLINE;
  /** 
 * Creates a new Presence representation for the provided JDAImpl instance
 * @param jda The not-null JDAImpl instance to use
 */
  public PresenceImpl(  JDAImpl jda){
    this.api=jda;
  }
  @Override public JDA getJDA(){
    return api;
  }
  @Override public OnlineStatus getStatus(){
    return status;
  }
  @Override public Game getGame(){
    return game;
  }
  @Override public boolean isIdle(){
    return idle;
  }
  @Override public void setStatus(  OnlineStatus status){
    if (status == OnlineStatus.UNKNOWN)     throw new IllegalArgumentException("Cannot set the presence status to an unknown OnlineStatus!");
    if (status == OnlineStatus.OFFLINE || status == null)     status=OnlineStatus.INVISIBLE;
    JSONObject object=getFullPresence();
    object.put("status",status.getKey());
    update(object);
    this.status=status;
  }
  @Override public void setGame(  Game game){
    JSONObject gameObj=getGameJson(game);
    if (gameObj == null) {
      update(getFullPresence().put("game",JSONObject.NULL));
      this.game=null;
      return;
    }
    JSONObject object=getFullPresence();
    object.put("game",gameObj);
    update(object);
    this.game=game;
  }
  @Override public void setIdle(  boolean idle){
    JSONObject object=getFullPresence();
    object.put("afk",idle);
    update(object);
    this.idle=idle;
  }
  public PresenceImpl setCacheStatus(  OnlineStatus status){
    if (status == null)     throw new NullPointerException("Null OnlineStatus is not allowed.");
    if (status == OnlineStatus.OFFLINE)     status=OnlineStatus.INVISIBLE;
    this.status=status;
    return this;
  }
  public PresenceImpl setCacheGame(  Game game){
    this.game=game;
    return this;
  }
  public PresenceImpl setCacheIdle(  boolean idle){
    this.idle=idle;
    return this;
  }
  public JSONObject getFullPresence(){
    JSONObject game=getGameJson(this.game);
    return new JSONObject().put("afk",idle).put("since",System.currentTimeMillis()).put("game",game == null ? JSONObject.NULL : game).put("status",getStatus().getKey());
  }
  private JSONObject getGameJson(  Game game){
    if (game == null || game.getName() == null || game.getType() == null)     return null;
    JSONObject gameObj=new JSONObject();
    gameObj.put("name",game.getName());
    gameObj.put("type",game.getType().getKey());
    if (game.getType() == Game.GameType.TWITCH && game.getUrl() != null)     gameObj.put("url",game.getUrl());
    return gameObj;
  }
  protected void update(  JSONObject data){
    api.getClient().send(new JSONObject().put("d",data).put("op",3).toString());
  }
}

